import { useParams } from "react-router-dom";
import ProvaApi from "../api/ProvaApi";
import Layout from "../components/Layout/Layout";
import Standings from "../components/standings/Standing";

const Leagues = () => {
	const {id} = useParams();
    const apiProva = new ProvaApi();
    const [playerData, setPlayerData] = useState([]);

	useEffect(() => {
        const fetchLeague = async () => {
            try {
                const responseplayerData = await apiProva.makeRequest(`api/playerData?id=${id}`);
                setPlayerData(responseplayerData.data);  
                console.log(playerData.data)     
            } catch (error) {
                console.log(error);
            }
        };

        fetchLeague(); 

    }, [id]);

	return (
		<>
			<Layout />
			<div className="text-black flex flex-col p-4 gap-3">
				<div className="flex flex-col md:flex-row gap-3">	
					<div className="flex basis-6/12">
					</div>
					<div className="flex basis-6/12">
						{/* <Standings id={87} /> */}
					</div>
				</div>
			</div>
		</>
	);
};

export default Leagues;
